import React from "react";

export default function FooterItem({
  footerSocialClassName,
  footerSocialUrl,
  footerITagClassName,
}) {
  return (
    <li>
      <a className="social-links" href={footerSocialUrl}>
        <i className={footerITagClassName} aria-hidden="true"></i>
      </a>
    </li>
  );
}
